import React from "react";
import { Link, Route } from "react-router-dom";
import logoVector from "../images/logo-Vector.svg"

export default function Header() {
  return (
    <header className="header">
      <img className="header__logo" src={logoVector} alt="Логотип Mesto Russia" />

<Route path="/signup">
    <Link to="/signin" className="header__link">Войти</Link>
</Route>

<Route path="/signin">
    <Link to="/signup" className="header__link">Регистрация</Link>
</Route>

<Route path="/cards">
      <div className="header__nav">
        <p className="header__email">email@gmail.com</p>
        <Link to="/signin" className="header__link">Выйти</Link>
      </div>
      </Route>
    </header>

  );
}
